"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[4679],{48635:(e,n,t)=>{t.r(n),t.d(n,{assets:()=>l,contentTitle:()=>o,default:()=>d,frontMatter:()=>a,metadata:()=>s,toc:()=>c});var i=t(85893),r=t(11151);const a={title:"FOCUS: Context Sensitive Help",authors:"keith-stewart",date:"2024-01-22",tags:["warsztat","articles-in-english"],coverImage:"context-sensitive-help.png"},o=void 0,s={permalink:"/context-sensitive-help",editUrl:"https://github.com/techwriter-pl/techwriter-pl.github.io/tree/main/blog/context-sensitive-help/index.md",source:"@site/blog/context-sensitive-help/index.md",title:"FOCUS: Context Sensitive Help",description:"The Journey",date:"2024-01-22T00:00:00.000Z",tags:[{label:"warsztat",permalink:"/tags/warsztat"},{label:"articles-in-english",permalink:"/tags/articles-in-english"}],readingTime:9.68,hasTruncateMarker:!0,authors:[{name:"Keith Stewart",role:"Autor",imageURL:"/img/avatars/keith-stewart.png",key:"keith-stewart"}],frontMatter:{title:"FOCUS: Context Sensitive Help",authors:"keith-stewart",date:"2024-01-22",tags:["warsztat","articles-in-english"],coverImage:"context-sensitive-help.png"},unlisted:!1,prevItem:{title:"MeetContentKRK stycze\u0144 2023",permalink:"/meet-content-krk-styczen-2024"},nextItem:{title:"Kilka pyta\u0144 do - cz\u0119\u015b\u0107 30: Tech writing spotyka marketing",permalink:"/kilka-pytan-do-czesc-30-marketing"}},l={authorsImageUrls:[void 0]},c=[{value:"The Journey",id:"the-journey",level:2},{value:"Evolution",id:"evolution",level:2},{value:"Case #1 Payment Portal \u2014 without CSH",id:"case-1-payment-portal--without-csh",level:2},{value:"Payment Portal Example Analysis",id:"payment-portal-example-analysis",level:3},{value:"Payment Portal Example Solution",id:"payment-portal-example-solution",level:3},{value:"Case #2: Technical Report \u2014 with CSH",id:"case-2-technical-report--with-csh",level:2},{value:"Technical Report Solution",id:"technical-report-solution",level:3},{value:"Technical Report Example Wrap-Up",id:"technical-report-example-wrap-up",level:3},{value:"Planning a CSH Project",id:"planning-a-csh-project",level:2},{value:"CSH Future",id:"csh-future",level:2}];function h(e){const n={a:"a",code:"code",h2:"h2",h3:"h3",img:"img",li:"li",ol:"ol",p:"p",pre:"pre",strong:"strong",ul:"ul",...(0,r.a)(),...e.components};return(0,i.jsxs)(i.Fragment,{children:[(0,i.jsx)(n.h2,{id:"the-journey",children:"The Journey"}),"\n",(0,i.jsx)(n.p,{children:"I have been a developer for more than 20 years and a technical writer for even\r\nlonger. One of the first commercial software applications I built was a mobile\r\nairline booking, payment, and travel management app. To create a viable mobile\r\nhelp system required me to design on-screen real-time help, focused on the\r\nspecific task a user was performing. This included tooltips for each task and\r\neach screen element. With limited screen real estate and limited device memory,\r\ntooltips had to be hyper focused and effective. My journey into context\r\nsensitive help (CSH) had begun."}),"\n",(0,i.jsx)(n.h2,{id:"evolution",children:"Evolution"}),"\n",(0,i.jsx)(n.p,{children:"Since my early developer years, the mobile landscape has evolved into the\r\npredominant software platform for consumers. A similar pace of evolution has not\r\nfully materialized for online help systems. While documentation has generally\r\nbecome more structured, there is still a void when considering instant, focused,\r\neffective context sensitive help (CSH). Current help systems still rely\r\npredominantly on linked PDF help files, online web help systems, and indexed\r\ndocument searches. Organizations use these help systems to manage large volumes\r\nof documentation and multiple systems and versions."}),"\n",(0,i.jsx)(n.p,{children:"To be sure, there are noticeable advancements in structured, versioned, and\r\nindexed help systems. GitHub, DITA, and service portals contribute to these\r\nstructured improvements. Yet, progress with real-time, in-place, targeted CSH\r\nhas not reached its full potential. CSH embraces a new focus on designing and\r\ndelivering help systems targeted to customer ease with finding the exact help\r\nneeded at the exact time needed. This represents a paradigm shift from an\r\norganization-managed cost-based focus to a customer-centric focus. Not an easy\r\njourney for most organizations, but a necessary journey, nonetheless."}),"\n",(0,i.jsx)(n.p,{children:"Let\u2019s compare two cases in terms of CSH. The first case is without CSH and the\r\nsecond case is with CSH. Both cases are real."}),"\n",(0,i.jsx)(n.p,{children:"The case without CSH is an existing online banking payment portal (no brands or\r\npersonal details). A short follow-up analysis and solution are presented after\r\nthe case example."}),"\n",(0,i.jsx)(n.h2,{id:"case-1-payment-portal--without-csh",children:"Case #1 Payment Portal \u2014 without CSH"}),"\n",(0,i.jsx)(n.p,{children:"The bank payment portal has the following data fields:"}),"\n",(0,i.jsxs)(n.ol,{children:["\n",(0,i.jsx)(n.li,{children:"Entity (with a drop-down list of previous recipients, if any)"}),"\n",(0,i.jsx)(n.li,{children:"Reference"}),"\n",(0,i.jsx)(n.li,{children:"Amount"}),"\n",(0,i.jsx)(n.li,{children:"Schedule Payment"}),"\n"]}),"\n",(0,i.jsx)(n.p,{children:(0,i.jsx)(n.img,{alt:"A screenshot of an online form with the fields mentioned above",src:t(16275).Z+"",width:"450",height:"296"})}),"\n",(0,i.jsx)(n.p,{children:"None of the above fields indicate if they are required or not (see screen\r\ncapture \u2013 no bank or personal information is included, only a sample of the\r\nonline form). The submit button is disabled until each is filled."}),"\n",(0,i.jsx)(n.p,{children:"None of the data fields have any CSH nor help icons nor auto text suggestions,\r\nnor any help at all. When you cursor out of a field, if you have not properly\r\ncompleted the field, you receive a warning message to complete the field before\r\nproceeding. There are no further instructions on how to complete the field.\r\nThere are no samples nor images of what a reference or entity field looks like.\r\nTo receive help, you have to click a help icon at the top of the bank web page.\r\nThis link forces you to leave your current page and open a chat AI. If you are\r\nnot fluent in the bank\u2019s default language, your help request results are likely\r\nto be unhelpful. If the help AI cannot understand or find a help topic for your\r\nrequest, the help AI will direct you to a human if you are within the support\r\ndesk working hours. In my case, my default language is English. My bank\u2019s\r\ndefault language is not English, so my search for help returned no results.\r\nAdditionally, I was outside the window of human support. Result: I could not\r\ncomplete my transaction."}),"\n",(0,i.jsx)(n.h3,{id:"payment-portal-example-analysis",children:"Payment Portal Example Analysis"}),"\n",(0,i.jsx)(n.p,{children:"The lack of help can result in a high probability of transaction failure. This\r\ncreates frustration for the customer and negative perceptions of the Bank. Also,\r\ntransferring the customer to a human assistant at this point in the transaction\r\nprocess is time-consuming, unnecessary, and costly for the Bank. Customer\r\nsatisfaction and retention may be jeopardized."}),"\n",(0,i.jsx)(n.h3,{id:"payment-portal-example-solution",children:"Payment Portal Example Solution"}),"\n",(0,i.jsx)(n.p,{children:"This payment application could be cost-effectively improved by including the\r\nfollowing simple CSH for each data field."}),"\n",(0,i.jsxs)(n.ol,{children:["\n",(0,i.jsx)(n.li,{children:"Entity \u2013 include a tooltip that shows what the required entity data looks\r\nlike with a sample from an invoice or bill showing the entity field."}),"\n",(0,i.jsx)(n.li,{children:"Reference \u2013 include a tooltip that shows what the reference data looks like\r\nwith a sample from an invoice or bill showing the reference field."}),"\n",(0,i.jsx)(n.li,{children:"Amount \u2013 include a tooltip showing the format for entering payment currency."}),"\n",(0,i.jsx)(n.li,{children:"Schedule Payment \u2013 include an explanation about time frames for scheduling.\r\nIf a schedule is not required, explain the default payment time-frame."}),"\n",(0,i.jsx)(n.li,{children:"Submit Button \u2013 include a roll-over tooltip explanation for required data\r\nbefore payment submission is allowed."}),"\n"]}),"\n",(0,i.jsx)(n.h2,{id:"case-2-technical-report--with-csh",children:"Case #2: Technical Report \u2014 with CSH"}),"\n",(0,i.jsx)(n.p,{children:"In the following example, I was tasked with creating a technical report about\r\nCOVID Lambda variant dynamics in Peru. My report included extensive and\r\ncustomizable data graphs and data tables that required explanation for\r\ninterpretation and use. Instead of creating a separate help file for the report,\r\nI decided to use the existing CSH for each data entity I had already created,\r\nand then allow the user to create an on-demand help document. This way, if a\r\nuser was interested in a particular data set in the report, they could get\r\ninstant help for their interest, instead of the traditional help document search\r\nmethod. Visit the link below to see how I built this CSH project."}),"\n",(0,i.jsx)(n.p,{children:"View the Technical Report on my page here:"}),"\n",(0,i.jsx)(n.p,{children:(0,i.jsx)(n.a,{href:"https://www.graphcube.com/cf/News/COVIDPeru.php",children:"https://www.graphcube.com/cf/News/COVIDPeru.php"})}),"\n",(0,i.jsx)(n.p,{children:"On the report page, try the following:"}),"\n",(0,i.jsxs)(n.ul,{children:["\n",(0,i.jsx)(n.li,{children:"Cursor over the charts to see all the embedded data."}),"\n",(0,i.jsx)(n.li,{children:"Click the column headers in Table #2 to sort the data."}),"\n",(0,i.jsxs)(n.li,{children:["Cursor over any of the red help icons ",(0,i.jsx)(n.img,{src:t(81102).Z+"",width:"24",height:"23"})," to view the CSH."]}),"\n",(0,i.jsxs)(n.li,{children:["At the end of the document in the ",(0,i.jsx)(n.strong,{children:"Get More Help"})," section, click the Create\r\nHelp File blue button. This will generate and open the on-demand help file in\r\na new tab (you may need to tell your browser to allow JavaScript popups from\r\ngraphcube.com). Remember, this is ",(0,i.jsx)(n.strong,{children:"NOT"})," a physical help document; it is\r\ngenerated in real-time on the button click event."]}),"\n"]}),"\n",(0,i.jsx)(n.h3,{id:"technical-report-solution",children:"Technical Report Solution"}),"\n",(0,i.jsxs)(n.p,{children:[(0,i.jsx)(n.strong,{children:"Prerequisite:"})," I created a series of tooltips using JavaScript. These\r\ntooltips are displayed when a user performs an ",(0,i.jsx)(n.code,{children:"onMouseOver"})," event for a help\r\nicon. Each tooltip is assigned a unique and sequential ID value. For example, my\r\ntooltip IDs start at \u2018CSD0000\u2019. Numbering is unimportant, but the prefix \u2018CSD\u2019\r\n(or anything you choose) will be used to collect all your ",(0,i.jsx)(n.code,{children:"onMouseOver"})," content\r\nlater."]}),"\n",(0,i.jsxs)(n.p,{children:[(0,i.jsx)(n.strong,{children:"Optional Header:"})," You can create a DIV tag with an ",(0,i.jsx)(n.code,{children:"onMouseOver"}),"\r\nintroduction/title content or any other desired content. You can choose to\r\ndisplay this content or not (style display attribute). For this example, I\r\nincluded a title, author, and a basic description of the report. I selected not\r\nto display this header in my Report, rather, I used this content for the\r\nIntroduction section of the on-demand Help Document."]}),"\n",(0,i.jsxs)(n.p,{children:[(0,i.jsx)(n.strong,{children:"Step 1:"})," For each graph or data table, I created a JavaScript ",(0,i.jsx)(n.code,{children:"onMouseOver"}),"\r\ntooltip with very minimal HTML formatting (see example Code Box 1 \u2013 this is the\r\nCSH for Chart #1 in the example document)."]}),"\n",(0,i.jsx)(n.p,{children:(0,i.jsx)(n.img,{alt:"A screen shot of a computer screen",src:t(27277).Z+"",width:"624",height:"251"})}),"\n",(0,i.jsxs)(n.p,{children:[(0,i.jsx)(n.strong,{children:"Step 2:"})," The tooltips created in Step 1 were wrapped inside a div container\r\nwith the sequential id value, as explained in the Prerequisite section above.\r\nThe style object display property of the tooltip div is initially set to none.\r\nThe ",(0,i.jsx)(n.code,{children:"onMouseOver"})," event triggers the display property to block (visible), the\r\n",(0,i.jsx)(n.code,{children:"onMouseOut"})," even returns the display property to none. This is the CSH element."]}),"\n",(0,i.jsxs)(n.p,{children:[(0,i.jsx)(n.strong,{children:"Step 3:"})," Keeping the CSH inline with the code tightly couples the help with\r\nthe original code, facilitating versioning and editing."]}),"\n",(0,i.jsxs)(n.p,{children:[(0,i.jsx)(n.strong,{children:"Step 4:"})," At the end of the document, I created an ",(0,i.jsx)(n.code,{children:"onClick"})," button and a\r\nsimple JavaScript function (see Code Box 2) that finds all elements with div id\r\nmatching \u201cCSD\u201d. The ",(0,i.jsx)(n.code,{children:"onMouseOver"})," content from each collected element is stored\r\nas an array variable. Essentially, the function is extracting all the content\r\nfrom the ",(0,i.jsx)(n.code,{children:"onMouseOver"})," events and writing this content to a variable. Minimal\r\nparsing removes the ",(0,i.jsx)(n.code,{children:"onMouseOver"})," function opening bracket - (\u2018- and replaces\r\nthe closing bracket -\u2018)- with an HTML <hr> element, purely for readability.\r\nAll HTML code and style elements within the ",(0,i.jsx)(n.code,{children:"onMouseOver"})," content are\r\ninterpreted as HTML."]}),"\n",(0,i.jsx)(n.pre,{children:(0,i.jsx)(n.code,{className:"language-html",children:"<script type=\"text/javascript\"\u203a\r\nfunction showModifiedContent() {\r\n  var divElements = document.querySelectorAll('div[id^=\"CSD\"]');\r\n  var allModifiedContent =\r\n    '<style>body{font-family:Helvetica, Arial, sans-serif;} #hTitle0{font-size:130%;} #hTitle1{font-size:120%;} #hTitle2{font-size:110%;}ol {list-style-type:none;counter-reset:item;}li.numeric::before {counter-increment: item;content:counter(item) \". \";color:red;}li.alpha-A::before {content: \"A. \";color:red;}li.alpha-T::before {content: \"T. \";color:red;}</style>'; // Initialize an empty string to accumulate all modified content\r\n\r\n  divElements.forEach(function (divElement) {\r\n    var onMouseOverContent = divElement.getAttribute('onmouseover');\r\n    if (onMouseOverContent) {\r\n      var modifiedContent = onMouseOverContent\r\n        .replace(/ddrivetip\\('/g, '')\r\n        .replace(/'\\);/g, '<hr size=l>');\r\n      allModifiedContent += modifiedContent + '<br>'; // Append each the accumulator\r\n    }\r\n  });\r\n\r\n  if (allModifiedContent) {\r\n    // Check if there's any modified content\r\n    var neWindow = window.open('', '_blank'); // Open a new window\r\n\r\n    var htmlContent =\r\n      '<html><head><title>Document Help File<title></head><body>';\r\n    htmlContent += allModifiedContent;\r\n    htmlContent += '</body><html>';\r\n\r\n    newMindow.document.write(htmlContent); // Write all modified content to the new window with a title\r\n    //newWindow.document.close(); // Close the document to finish loading\r\n  }\r\n}\r\n<\/script>\n"})}),"\n",(0,i.jsxs)(n.p,{children:[(0,i.jsx)(n.strong,{children:"Step 5:"})," The ",(0,i.jsx)(n.code,{children:"onClick"})," button event writes the content from the collection\r\nvariable to a new HTML tab, essentially creating an on-demand help file. This\r\ntab can be printed or saved."]}),"\n",(0,i.jsxs)(n.p,{children:[(0,i.jsx)(n.strong,{children:"Optional Footer:"})," Similar to the header, you can create a footer for your\r\ndocument in an ",(0,i.jsx)(n.code,{children:"onMouseOver"})," event. For this report, I included basic\r\nreferences."]}),"\n",(0,i.jsx)(n.h3,{id:"technical-report-example-wrap-up",children:"Technical Report Example Wrap-Up"}),"\n",(0,i.jsx)(n.p,{children:"Obvious advantages of this CSH approach include a tight coupling of the\r\napplication with the help content, versioning control in-sync with application\r\nversioning, and on-demand documentation generation. This approach is code\r\nagnostic and can be implemented in any developer language (python, PHP, Java,\r\netc.). JavaScript events can be changed to other objects that fit developer and\r\ncustomer requirements. For larger applications, greater customization and code\r\noptimization can be achieved by creating CSH references to external JSON, XML,\r\ntext, or database generated help content."}),"\n",(0,i.jsx)(n.h2,{id:"planning-a-csh-project",children:"Planning a CSH Project"}),"\n",(0,i.jsx)(n.p,{children:"Planning and creating a CSH project can be a straightforward process. Key\r\nconsiderations include which applications are best suited for short, targeted\r\ntask-based CSH and which applications or systems require more extensive help.\r\nTask-based user actions such as configuration, installation, data entry and form\r\ncompletion are good candidates for CSH. Descriptive, product, and marketing\r\ndocuments (little or no direct user action) may not be the best projects for\r\nCSH. In many cases, extensive help documentation can be enhanced by short,\r\nfocused, and targeted CSH. I like to think of extensive help documents similar\r\nto coding principles: compartmentalizing code based on a discrete function\r\nperformed by the code. The same thought process can be applied to CSH. CSH\r\nimplementation is flexible and can fit into common language platforms including\r\nJavaScript, PHP, Python, C, Java, etc."}),"\n",(0,i.jsx)(n.h2,{id:"csh-future",children:"CSH Future"}),"\n",(0,i.jsx)(n.p,{children:"Eventually, applications will require CSH for use by AI to generate predictive\r\nand responsive help targeted to user behavior. CSH represents discreet, focused\r\nhelp content that can be used for effective customer metrics. Customer use\r\npatterns and bottlenecks are rapidly identified and can be discretely addressed.\r\nGiven the component nature of CSH, complex or frequently used help components\r\ncould be easily bookmarked by customers in an on-demand virtual notebook for\r\neasy access. Imagine a complex configuration setting or complex task for an\r\napplication, which could be bookmarked, and then called up from a real-time\r\nonscreen one-click bookmark. Instead of application-centric and help-centric\r\nseparate approaches, CSH becomes integrated with application functionality in a\r\nunified object that better serves the end user."})]})}function d(e={}){const{wrapper:n}={...(0,r.a)(),...e.components};return n?(0,i.jsx)(n,{...e,children:(0,i.jsx)(h,{...e})}):h(e)}},27277:(e,n,t)=>{t.d(n,{Z:()=>i});const i=t.p+"assets/images/codebox1-8dd291e7f3aa4a6bc2de3d66aff18109.png"},81102:(e,n,t)=>{t.d(n,{Z:()=>i});const i="data:image/png;base64,"},16275:(e,n,t)=>{t.d(n,{Z:()=>i});const i="data:image/png;base64,"},11151:(e,n,t)=>{t.d(n,{Z:()=>s,a:()=>o});var i=t(67294);const r={},a=i.createContext(r);function o(e){const n=i.useContext(a);return i.useMemo((function(){return"function"==typeof e?e(n):{...n,...e}}),[n,e])}function s(e){let n;return n=e.disableParentContext?"function"==typeof e.components?e.components(r):e.components||r:o(e.components),i.createElement(a.Provider,{value:n},e.children)}}}]);